import React from "react";
import "./header.css";

export default function Header() {
    return (
        <dev className="header">
            <div className="headerTitles">
                <span className="headerTitleSm">React & Node</span>
                <span className="headerTitleLg">Blog</span>

            </div>
            <img className="headerImg" src="https://res.cloudinary.com/stealthman22/image/upload/v1586308023/new-portfolio/hero/two-cargo-ships-sailing-near-city-2144905.jpg" alt="" />
        </dev>
    )
}

